import React, { useContext,useState } from 'react'
import { contextData } from './Context'

export const LabelTwo = () => {
    const[data]=useContext(contextData);
    const [load,setLoad] = useState(true);
    const [st,setst] =useState(15);
    const [ldbn,setlbdn]=useState("LOAD MORE");
    const loadbtn=()=>{
        setLoad(!load);
        if (load){
            setst(19);
            setlbdn("LOAD LESS");
        }
        else{
            setst(15);
            setlbdn("LOAD MORE")
        };
    }

    return (
        <div className='label2parent'>
            {data.filter((x)=>x.id>7&&x.id<st).map((x)=>{
                if(x.id==8){
                return(
                    <div className='childl2'>
                    <img src={x.image} height={'180px'}/>
                    <span className='textl2'>
                    <h4>{x.title}</h4>
                    <p>{x.content.slice(0,100)}</p>
                    <span><b>{x.category}</b> / {x.date}</span>
                    <hr className='hrstl2'/>
                    </span>
                    </div>
                )}else{
                return(
                    <div className='childl2'>
                     <img src={x.image}/>
                     <span>
                    <h4>{x.title}</h4>
                    <p>{x.content.slice(0,100)}</p>
                    <span><b>{x.category}</b> / {x.date}</span>
                    <hr className='hrstl2'/>
                    </span>
                    </div>
                    )  
                }
            })}
            <b onClick={loadbtn}><i className='fas fa-arrow-up'/> &nbsp; {ldbn}</b>
        </div>
    )
}
